INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4419, 1744, 'Codeine', 'Ethanol may potentiate the central nervous system (CNS) depressant effects of opioid analgesics.  Concomitant use may result in additive CNS depression and impairment of judgment, thinking, and psychomotor skills.  In more severe cases, hypotension, respiratory depression, profound sedation, coma, or even death may occur.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'789c0dcad10d80300805c055de042ee124d8a290545e13a8aeaff77d3ba3f1f69228ac54f004a7d33b24645c9ade12af9741cb243890c6353a0e853cffd3be7d767b1967', NULL, X'');
