INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (4566, 14420, 'Alpelisib', 'Food significantly enhances the oral absorption and bioavailability of alpelisib.  When administered with a high-fat high-calorie meal (985 calories with 58.1 g of fat) or a low-fat low-calorie meal (334 calories with 8.7 g of fat) the AUC and Cmax of a single dose of alpelisib was increased by 73% and 84% and 77% and 145%, respectively.  There were no clinically significant differences in alpelisib AUC between the two types of meals.  In addition, food appears to have a more pronounced effect on the solubility of alpelisib than gastric pH.', 'high-fat foods', 'Moderate', '', 'DDInter', 0, X'789c0dc4d10980300c05c055de00e2342e90d2401f248d242d3abedec75d019db553e1f2d2c510f927ad22efc59807c46e35161b6ac4b68ea690ee9caca5a91d0fd780c055ecfc00bebf1da8', NULL, X'');
